import{_ as a}from"./plugin-vue_export-helper-c27b6911.js";import{r as e,o as t,c as p,b as n,e as o,w as c,f as l}from"./app-50124fd5.js";const i={},u={align:"center"},r=n("b",null,"Effective Java",-1),k=l(`<h1 id="第一章-创建和销毁对象" tabindex="-1"><a class="header-anchor" href="#第一章-创建和销毁对象" aria-hidden="true">#</a> 第一章 创建和销毁对象</h1><h2 id="用静态工厂方法代替构造器" tabindex="-1"><a class="header-anchor" href="#用静态工厂方法代替构造器" aria-hidden="true">#</a> 用静态工厂方法代替构造器</h2><h2 id="遇到多个构造参数时考虑使用构建器" tabindex="-1"><a class="header-anchor" href="#遇到多个构造参数时考虑使用构建器" aria-hidden="true">#</a> 遇到多个构造参数时考虑使用构建器</h2><h2 id="用私有构造器或枚举类型强化singleton属性" tabindex="-1"><a class="header-anchor" href="#用私有构造器或枚举类型强化singleton属性" aria-hidden="true">#</a> 用私有构造器或枚举类型强化Singleton属性</h2><h2 id="通过私有构造器强化不可实例化的能力" tabindex="-1"><a class="header-anchor" href="#通过私有构造器强化不可实例化的能力" aria-hidden="true">#</a> 通过私有构造器强化不可实例化的能力</h2><h2 id="优先考虑依赖注入来引用资源" tabindex="-1"><a class="header-anchor" href="#优先考虑依赖注入来引用资源" aria-hidden="true">#</a> 优先考虑依赖注入来引用资源</h2><h2 id="避免创建不必要的对象" tabindex="-1"><a class="header-anchor" href="#避免创建不必要的对象" aria-hidden="true">#</a> 避免创建不必要的对象</h2><p>尽可能的重用单个对象，而不是每次需要的时候创建一个相同功能的新对象，如果对象是不可变的（immutable），那么它就始终可以被重用。如果在循环语句或者频繁调用的方法中创建该对象，对性能或内存有很大的影响。</p><p>示例一（错误写法）：</p><p>String s = new String(&quot;bikini&quot;);</p><p>说明：该语句每次被执行的时候都会创建一个新的String实例，没有必须使用new String()构造器，参数&quot;bikini&quot;本身就是一个String实例，对于相同的字符串常量实例，该实例就会被重用。功能相同的情况下，如果在循环或频繁调用的方法中，就会创建大量不必要的String实例。</p><p>注意事项二：</p><p>​ 对于同时提供了静态工厂方法和构造器的不可变类，通常优先使用静态工厂方法，以避免创建不必要的对象。</p><p>​ 构造器每次被调用的时候都会创建一个新的对象，而静态工厂方法不会，除了重用不可变的对象之外，也可以重用那些已知不会被修改的可变对象。</p><p>示例：静态工厂方法 Boolean.valueOf(String s) 总是优先于构造器 new Boolean(String);</p><div class="language-java line-numbers-mode" data-ext="java"><pre class="language-java"><code><span class="token keyword">public</span> <span class="token keyword">static</span> <span class="token class-name">Boolean</span> <span class="token function">valueOf</span><span class="token punctuation">(</span><span class="token class-name">String</span> s<span class="token punctuation">)</span> <span class="token punctuation">{</span>
    <span class="token keyword">return</span> <span class="token function">parseBoolean</span><span class="token punctuation">(</span>s<span class="token punctuation">)</span> <span class="token operator">?</span> <span class="token constant">TRUE</span> <span class="token operator">:</span> <span class="token constant">FALSE</span><span class="token punctuation">;</span>
<span class="token punctuation">}</span>
<span class="token keyword">public</span> <span class="token keyword">static</span> <span class="token keyword">boolean</span> <span class="token function">parseBoolean</span><span class="token punctuation">(</span><span class="token class-name">String</span> s<span class="token punctuation">)</span> <span class="token punctuation">{</span>
    <span class="token keyword">return</span> <span class="token punctuation">(</span><span class="token punctuation">(</span>s <span class="token operator">!=</span> <span class="token keyword">null</span><span class="token punctuation">)</span> <span class="token operator">&amp;&amp;</span> s<span class="token punctuation">.</span><span class="token function">equalsIgnoreCase</span><span class="token punctuation">(</span><span class="token string">&quot;true&quot;</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>注意事项三：</p><p>​ 对于创建成本高的“昂贵/重量级的对象”，建议缓存下来使用，如下面的正则表达式（判断是否为罗马数字）：</p><div class="language-java line-numbers-mode" data-ext="java"><pre class="language-java"><code><span class="token comment">// Performance can be grately improved!</span>
<span class="token keyword">static</span> <span class="token keyword">boolean</span> <span class="token function">isRomanNumeral</span><span class="token punctuation">(</span><span class="token class-name">String</span> s<span class="token punctuation">)</span><span class="token punctuation">{</span>
    <span class="token keyword">return</span> s<span class="token punctuation">.</span><span class="token function">matches</span><span class="token punctuation">(</span><span class="token string">&quot;^(?=.)M*(C[MD]|D?C{0,3})&quot;</span><span class="token operator">+</span><span class="token string">&quot;(X[CL]|L?X{0,3})(I[XV]|V?I{0,3})$&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>对于 matches 方法，查看一个字符串是否与正则表达式匹配，但不适合在注重性能的场景使用，因为它每次都会创建一个Pattern 实例，却只用了一次，之后就会被垃圾回收。创建 Pattern 的成本很高，为了提升性能，应该将正则表达式编译为一个 Pattern 实例，缓存起来，每次调用的 isRomanNumeral 方法的时候重用该实例。</p><div class="language-java line-numbers-mode" data-ext="java"><pre class="language-java"><code><span class="token comment">// Reusing expensive object for improved performance</span>
<span class="token keyword">public</span> <span class="token keyword">class</span> <span class="token class-name">RomanNumerals</span><span class="token punctuation">{</span>
    <span class="token keyword">private</span> <span class="token keyword">static</span> <span class="token keyword">final</span> <span class="token class-name">Pattern</span> <span class="token constant">ROMAN</span> <span class="token operator">=</span> 
        <span class="token class-name">Pattern</span><span class="token punctuation">.</span><span class="token function">compile</span><span class="token punctuation">(</span><span class="token string">&quot;^(?=.)M*(C[MD]|D?C{0,3})&quot;</span><span class="token operator">+</span><span class="token string">&quot;(X[CL]|L?X{0,3})(I[XV]|V?I{0,3})$&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token keyword">static</span> <span class="token keyword">boolean</span> <span class="token function">isRomanNumeral</span><span class="token punctuation">(</span><span class="token class-name">String</span> s<span class="token punctuation">)</span><span class="token punctuation">{</span>
        <span class="token keyword">return</span> <span class="token constant">ROMAN</span><span class="token punctuation">.</span><span class="token function">matcher</span><span class="token punctuation">(</span>s<span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">matches</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token punctuation">}</span>
<span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>改进后的 isRomanNumeral 方法如果被频繁调用，会有明显的性能优势，此外，给正则表达式起一个名字，更加有可读性。</p><p>注意事项三：</p><p>注意事项四：</p><p>优先使用基本类型而不是装箱类型，自动拆装箱可能也会创建多余的对象，如包装类频繁作为计算值儿大量创建对象。</p><div class="language-java line-numbers-mode" data-ext="java"><pre class="language-java"><code><span class="token comment">// 计算所有正整数和</span>
<span class="token comment">// Hideously slow!</span>
<span class="token keyword">private</span> <span class="token keyword">static</span> <span class="token keyword">long</span> <span class="token function">sum</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">{</span>
    <span class="token class-name">Long</span> sum <span class="token operator">=</span> <span class="token number">0L</span><span class="token punctuation">;</span>
    <span class="token keyword">for</span><span class="token punctuation">(</span><span class="token keyword">int</span> i <span class="token operator">=</span> <span class="token number">0</span><span class="token punctuation">;</span>i <span class="token operator">&lt;=</span> <span class="token class-name">Integer</span><span class="token punctuation">.</span><span class="token constant">MAX_VALUE</span><span class="token punctuation">;</span>i<span class="token operator">++</span><span class="token punctuation">)</span><span class="token punctuation">{</span>
		sum <span class="token operator">+=</span> i<span class="token punctuation">;</span>
    <span class="token punctuation">}</span>
    <span class="token keyword">return</span> sum<span class="token punctuation">;</span>
<span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>以上代码会创建 2 的 31 次方个 Long 实例，对性能影响很大。</p><p>注意事项五：</p><h2 id="消除过期的对象引用" tabindex="-1"><a class="header-anchor" href="#消除过期的对象引用" aria-hidden="true">#</a> 消除过期的对象引用</h2><h2 id="避免使用终结方法和清除方法" tabindex="-1"><a class="header-anchor" href="#避免使用终结方法和清除方法" aria-hidden="true">#</a> 避免使用终结方法和清除方法</h2><h2 id="try-with-resources-优先于-try-finally" tabindex="-1"><a class="header-anchor" href="#try-with-resources-优先于-try-finally" aria-hidden="true">#</a> try-with-resources 优先于 try-finally</h2><p>Java类库中必须调用 close 方法关闭资源，如 InputStream、OutputStream、java.sql.Connection都需要关闭资源，否则造成严重的性能问题，try-finally 能够确保资源被正确关闭，但不够好，也存在许多问题。</p><p>注意事项一：</p><p>对于单个资源：</p><div class="language-java line-numbers-mode" data-ext="java"><pre class="language-java"><code>    <span class="token comment">// try-finally no logger the best way to close resources!</span>
    <span class="token keyword">private</span> <span class="token keyword">static</span> <span class="token class-name">String</span> <span class="token function">firstLineOfFile</span><span class="token punctuation">(</span><span class="token class-name">String</span> path<span class="token punctuation">)</span> <span class="token keyword">throws</span> <span class="token class-name">IOException</span> <span class="token punctuation">{</span>
        <span class="token class-name">BufferedReader</span> br <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">BufferedReader</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token class-name">FileReader</span><span class="token punctuation">(</span>path<span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
        <span class="token keyword">try</span> <span class="token punctuation">{</span>
            <span class="token keyword">return</span> br<span class="token punctuation">.</span><span class="token function">readLine</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
        <span class="token punctuation">}</span> <span class="token keyword">finally</span> <span class="token punctuation">{</span>
            br<span class="token punctuation">.</span><span class="token function">close</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
        <span class="token punctuation">}</span>
    <span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>对于多个资源：</p><div class="language-java line-numbers-mode" data-ext="java"><pre class="language-java"><code>	<span class="token keyword">private</span> <span class="token keyword">static</span> <span class="token keyword">int</span> <span class="token constant">BUFFER_SIZE</span> <span class="token operator">=</span> <span class="token number">1024</span><span class="token punctuation">;</span>

    <span class="token keyword">private</span> <span class="token keyword">static</span> <span class="token keyword">void</span> <span class="token function">copy</span><span class="token punctuation">(</span><span class="token class-name">String</span> src<span class="token punctuation">,</span> <span class="token class-name">String</span> dst<span class="token punctuation">)</span> <span class="token keyword">throws</span> <span class="token class-name">IOException</span> <span class="token punctuation">{</span>
        <span class="token class-name">FileInputStream</span> fis <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">FileInputStream</span><span class="token punctuation">(</span>src<span class="token punctuation">)</span><span class="token punctuation">;</span>
        <span class="token keyword">try</span> <span class="token punctuation">{</span>
            <span class="token class-name">FileOutputStream</span> fos <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">FileOutputStream</span><span class="token punctuation">(</span>dst<span class="token punctuation">)</span><span class="token punctuation">;</span>
            <span class="token keyword">try</span> <span class="token punctuation">{</span>
                <span class="token keyword">byte</span><span class="token punctuation">[</span><span class="token punctuation">]</span> bytes <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token keyword">byte</span><span class="token punctuation">[</span><span class="token constant">BUFFER_SIZE</span><span class="token punctuation">]</span><span class="token punctuation">;</span>
                <span class="token keyword">int</span> len<span class="token punctuation">;</span>
                <span class="token keyword">while</span> <span class="token punctuation">(</span><span class="token punctuation">(</span>len <span class="token operator">=</span> fis<span class="token punctuation">.</span><span class="token function">read</span><span class="token punctuation">(</span>bytes<span class="token punctuation">)</span><span class="token punctuation">)</span> <span class="token operator">&gt;=</span> <span class="token number">0</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
                    fos<span class="token punctuation">.</span><span class="token function">write</span><span class="token punctuation">(</span>bytes<span class="token punctuation">,</span> <span class="token number">0</span><span class="token punctuation">,</span> len<span class="token punctuation">)</span><span class="token punctuation">;</span>
                <span class="token punctuation">}</span>
            <span class="token punctuation">}</span> <span class="token keyword">finally</span> <span class="token punctuation">{</span>
                fos<span class="token punctuation">.</span><span class="token function">close</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
            <span class="token punctuation">}</span>
        <span class="token punctuation">}</span> <span class="token keyword">finally</span> <span class="token punctuation">{</span>
            fis<span class="token punctuation">.</span><span class="token function">close</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
        <span class="token punctuation">}</span>
    <span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>以上两种方式，即便使用 try-finally 关闭了资源，但也存在问题，因为 try 和 finally 中的代码都会抛出异常，例如方法 firstLineOfFile ，如果底层的物理设备异常，name调用 readLine 就会抛出异常，基于同样的原因，调用 close 方法，也会出现异常，此时，第二个异常就会抹除第一个异常，在异常的堆栈中是没有第一个异常的记录信息的，这样就会导致再现实中调试变得很困难，虽然可以通过编写代码禁止第二个异常，保留第一个异常，但过于繁琐不建议使用。</p><p>​ Java7 引入 try-with-resources 来关闭资源，如果一个类必须是被关闭的资源，那么这个类应该实现 AutoCloseable 接口，其中包含 close 方法，Java类库和第三方类库的许多类和接口都实现或扩展了 AutoCloseable 接口。</p><p>示例：</p><div class="language-java line-numbers-mode" data-ext="java"><pre class="language-java"><code>    <span class="token comment">// try-with-resources the best way to close resources!</span>
    <span class="token keyword">private</span> <span class="token keyword">static</span> <span class="token class-name">String</span> <span class="token function">firstLineOfFile</span><span class="token punctuation">(</span><span class="token class-name">String</span> path<span class="token punctuation">)</span> <span class="token keyword">throws</span> <span class="token class-name">IOException</span> <span class="token punctuation">{</span>
        <span class="token keyword">try</span> <span class="token punctuation">(</span><span class="token class-name">BufferedReader</span> br <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">BufferedReader</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token class-name">FileReader</span><span class="token punctuation">(</span>path<span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
            <span class="token keyword">return</span> br<span class="token punctuation">.</span><span class="token function">readLine</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
        <span class="token punctuation">}</span>
    <span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><div class="language-java line-numbers-mode" data-ext="java"><pre class="language-java"><code>    <span class="token keyword">private</span> <span class="token keyword">static</span> <span class="token keyword">void</span> <span class="token function">copy2</span><span class="token punctuation">(</span><span class="token class-name">String</span> src<span class="token punctuation">,</span> <span class="token class-name">String</span> dst<span class="token punctuation">)</span> <span class="token keyword">throws</span> <span class="token class-name">IOException</span> <span class="token punctuation">{</span>
        <span class="token keyword">try</span> <span class="token punctuation">(</span><span class="token class-name">FileInputStream</span> fis <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">FileInputStream</span><span class="token punctuation">(</span>src<span class="token punctuation">)</span><span class="token punctuation">;</span>
             <span class="token class-name">FileOutputStream</span> fos <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">FileOutputStream</span><span class="token punctuation">(</span>dst<span class="token punctuation">)</span><span class="token punctuation">;</span>
        <span class="token punctuation">)</span> <span class="token punctuation">{</span>
            <span class="token keyword">byte</span><span class="token punctuation">[</span><span class="token punctuation">]</span> bytes <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token keyword">byte</span><span class="token punctuation">[</span><span class="token constant">BUFFER_SIZE</span><span class="token punctuation">]</span><span class="token punctuation">;</span>
            <span class="token keyword">int</span> len<span class="token punctuation">;</span>
            <span class="token keyword">while</span> <span class="token punctuation">(</span><span class="token punctuation">(</span>len <span class="token operator">=</span> fis<span class="token punctuation">.</span><span class="token function">read</span><span class="token punctuation">(</span>bytes<span class="token punctuation">)</span><span class="token punctuation">)</span> <span class="token operator">&gt;=</span> <span class="token number">0</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
                fos<span class="token punctuation">.</span><span class="token function">write</span><span class="token punctuation">(</span>bytes<span class="token punctuation">,</span> <span class="token number">0</span><span class="token punctuation">,</span> len<span class="token punctuation">)</span><span class="token punctuation">;</span>
            <span class="token punctuation">}</span>
        <span class="token punctuation">}</span>
    <span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>​ 使用 try-with-resources 不仅使代码变得简洁易懂，更容易诊断错误，以 firstLineOfFile 为例，如果调用 readLine 和（不可见的）close 方法都抛出异常，后一个异常就会被禁止，以保留第一个异常，被禁止的异常不是被抛弃了，而是会被打印到堆栈中，并标注为被禁止的异常，通过编程 getSuppressed 方法可以访问，该方法被添加到 Throwable中了。</p><p>​ 同时 try-with-resources 还可以使用 catch 语句，这样既可以处理异常，又不用再外嵌套一层代码，如一下代码，无法打开文件时，就会返回一个默认值。</p><div class="language-java line-numbers-mode" data-ext="java"><pre class="language-java"><code>    <span class="token comment">// try-with-resources with catch</span>
    <span class="token keyword">private</span> <span class="token keyword">static</span> <span class="token class-name">String</span> <span class="token function">firstLineOfFile</span><span class="token punctuation">(</span><span class="token class-name">String</span> path<span class="token punctuation">,</span> <span class="token class-name">String</span> defaultValue<span class="token punctuation">)</span> <span class="token keyword">throws</span> <span class="token class-name">IOException</span> <span class="token punctuation">{</span>
        <span class="token keyword">try</span> <span class="token punctuation">(</span><span class="token class-name">BufferedReader</span> br <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">BufferedReader</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token class-name">FileReader</span><span class="token punctuation">(</span>path<span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
            <span class="token keyword">return</span> br<span class="token punctuation">.</span><span class="token function">readLine</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
        <span class="token punctuation">}</span> <span class="token keyword">catch</span> <span class="token punctuation">(</span><span class="token class-name">IOException</span> e<span class="token punctuation">)</span> <span class="token punctuation">{</span>
            <span class="token keyword">return</span> defaultValue<span class="token punctuation">;</span>
        <span class="token punctuation">}</span>
    <span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>结论：处理必须关闭的资源<mark>时</mark>，始终优先考虑 try-with-resources 而不是 try-finally ，这样得到的代码更加简介清晰，产生的异常更有价值。</p><h1 id="第二章-对于所有对象都通用的方法" tabindex="-1"><a class="header-anchor" href="#第二章-对于所有对象都通用的方法" aria-hidden="true">#</a> 第二章 对于所有对象都通用的方法</h1><h2 id="覆盖-equals-时请遵守通用约定" tabindex="-1"><a class="header-anchor" href="#覆盖-equals-时请遵守通用约定" aria-hidden="true">#</a> 覆盖 equals 时请遵守通用约定</h2><h2 id="覆盖-equals-时总要覆盖-hashcode" tabindex="-1"><a class="header-anchor" href="#覆盖-equals-时总要覆盖-hashcode" aria-hidden="true">#</a> 覆盖 equals 时总要覆盖 hashCode</h2><h2 id="始终覆盖-tostring" tabindex="-1"><a class="header-anchor" href="#始终覆盖-tostring" aria-hidden="true">#</a> 始终覆盖 toString</h2><h2 id="谨慎覆盖-clone" tabindex="-1"><a class="header-anchor" href="#谨慎覆盖-clone" aria-hidden="true">#</a> 谨慎覆盖 clone</h2><h2 id="考虑实现-comparable-接口" tabindex="-1"><a class="header-anchor" href="#考虑实现-comparable-接口" aria-hidden="true">#</a> 考虑实现 Comparable 接口</h2><h1 id="第三章-类和接口" tabindex="-1"><a class="header-anchor" href="#第三章-类和接口" aria-hidden="true">#</a> 第三章 类和接口</h1>`,53);function d(v,m){const s=e("font");return t(),p("div",null,[n("div",u,[o(s,{size:"70"},{default:c(()=>[r]),_:1})]),k])}const y=a(i,[["render",d],["__file","Effective Java.html.vue"]]);export{y as default};
